import React from 'react'
import Latestitem from '../LatestItem.jsx/Latestitem';
import Latestheading from '../Latestheading/Latestheading';
import { NavLink } from 'react-router-dom';
import axios from 'axios';
import Letest from './Letest.css';
import { useEffect } from 'react';
import { useState } from 'react';
function Latest() {
  const [data,setdata]=useState([]);
  useEffect(()=>{
    const getdata=async()=>{
          const res=await axios.get("http://localhost:5000/api/latest");
          setdata(res.data);
          console.log(data);
      
    }
    getdata()
  },[])
  return (
    <div className='latest'>
      <Latestheading data={{name1:"The",name2:"Latest" }}/>
      <div className='latest-item'>
        {
          data.map((data)=>{
               
            <NavLink to="/test/34" className="Nav">
          <Latestitem item={data}/>
           </NavLink>
          })
        }
        
      
      </div>
    </div>
  )
}

export default Latest
